create database ActividadIntegradora
go
use ActividadIntegradora
go
create table Tecnicos(
    ID int not null primary key,
    Apellido varchar(50) not null,
    Nombre varchar(50) not null
)
go
create table Clientes(
    ID int not null primary key,
    Apellido varchar(50) not null,
    Nombre varchar(50) not null,
    Tipo char not null check (Tipo in ('E', 'P'))
)
go
create table TiposServicio(
    ID int not null primary key,
    Descripcion varchar(100) not null
)
go
create table Servicios(
    ID int not null primary key identity(1, 1),
    IDTecnico int not null,
    IDCliente int not null,
    IDTipo int not null ,
    Importe money not null check (Importe >= 0),
    Duracion int not null check (Duracion >= 0),
    Fecha date not null,
    DiasGarantia int not null check (DiasGarantia >= 0),
    FormaPago char check (FormaPago in ('E', 'C', 'T', 'B')),
    foreign key (IDTecnico) references Tecnicos(ID),
    foreign key (IDCliente) references Clientes(ID),
    foreign key (IDTipo) references TiposServicio(ID)
)
go
